    render() {
        return (
            <section id="container-about" className="container-about">
                    <h1>About Me</h1> 

                    <img src={biologo} width="180" height="180" alt="abtimg"/>
                    <p>**Writes something about the not so interesting thapelo.
                        I'm an aspiring fullstack developer,currently setting his sights on learning more about mobile/web development, and completing my studies at WeThinkCode_ . <br/>
                    It should have a home page that tells us a bit about yourself  <br/>
                    Feel free to express yourself in the design. Think of this task as creating a mini-portfolio page. <br/>                       
                    </p>

            </section>
        )
    }
}

export default About
